import React from "react";

export default function sequence_comparisons() {
  return (
    <div className="sequence_comparisons-wrap">
      <div className="seq-wrap">
        <h2>Sequence 1</h2>
      </div>
      <div className="seq-wrap">
        <h2>Sequence 2</h2>
      </div>

      <div className="btm-seq-wrap">
        <button className="compare-btn">Compare</button>
      </div>
    </div>
  );
}
